import React, { Component } from "react";

export class Footer extends Component {
  render() {
    return (
      <div>
        <div className="card text-center bg-dark text-muted">
          <div className="card-header ">CONTACT US</div>
          <div className="card-body">
            <h5 className="card-title">My Feed , My News</h5>
            <p className="card-text">
              Provides you most recently news here.
            </p>
           
          </div>
          <div className="card-footer text-muted">Developed By:<a href={"https://github.com/Dev4821"} className="link-dark" target="_blank" rel="noreferrer">Divyansh</a></div>
        </div>
      </div>
    );
  }
}

export default Footer;
